import{isTopLevelDeclaration}from"../parser/tokenizer";import{TokenType as tt}from"../parser/tokenizer/types";export const EMPTY_DECLARATION_INFO={typeDeclarations:new Set,valueDeclarations:new Set};export default function getDeclarationInfo(e){const t=new Set,o=new Set;for(let n=0;n<e.tokens.length;n++){const r=e.tokens[n];r.type===tt.name&&isTopLevelDeclaration(r)&&(r.isType?t.add(e.identifierNameForToken(r)):o.add(e.identifierNameForToken(r)))}return{typeDeclarations:t,valueDeclarations:o}}